INSERT INTO notificacionprofe VALUES("1","Primer parcial","2020-09-24 20:17:24","Buen día chic@s!\n\n\n\nRecuerden que el martes que viene es el primer parcial y tienen que estudiar todo lo que vimos en las dos primeras unidades.\n\n\n\nSaludos!\n\n","1","62","0000-00-00","0000-00-00");
INSERT INTO notificacionprofe VALUES("2","Notas del primer parcial","2020-09-24 21:36:48","Buenos días chic@s!\n\n\n\nLa próxima clase voy a entregar las notas del primer parcial.","1","62","0000-00-00","0000-00-00");
INSERT INTO notificacionprofe VALUES("3","Aviso para el martes","2020-10-09 17:15:29","Buenas tardes chic@s!\n\n\n\nLes recuerdo que el martes que viene empezamos con la unidad 5. Igualmente antes de empezar vamos a hacer un repaso de lo visto hasta el momento.\n\n\n\nSaludos.","1","9","0000-00-00","0000-00-00");
INSERT INTO notificacionprofe VALUES("4","Última etapa del año","2020-10-13 01:02:38","Buenos días chic@s!\n\nQuería informarles que comenzamos la última etapa del año donde vamos a dar un cierre a la materia y tratar de aclarar todas las dudas que tengan.\nEspero que lleguemos al final del año con todos los temas aprendidos y sin dudas.\n","7","62","0000-00-00","0000-00-00");





